  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Blackwater
  National Wildlife Refuge outlines Refuge accomplishments during the 1986 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance is given. Habitat management is also covered; subjects include wetlands,
  forests, croplands, fire management, and pest control. The wildlife section of the
  report discusses endangered and threatened species, waterfowl, marsh and water birds,
  shorebirds, raptors, other migratory birds, game mammals, other resident wildlife,
  surplus animal disposal, animal control, marking and bird banding, and disease prevention
  and control. The public uses of the Refuge described in this report include outdoor
  classrooms, information and interpretation, hunting, fishing, wildlife observation,
  and law enforcement. The equipment and facilities section of the report provides
  information about new construction, rehabilitation, equipment utilization and replacement,
  communication systems, computer systems, and energy conservation. Cooperative programs
  and items of interest are provided at the end. Photographs, Refuge brochures, and
  brief narrative reports for Glen L. Martin National Wildlife Refuge and Susquehanna
  National Wildlife Refuge are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
